def count_divisible_palindromes():
    count = 0
    for a in range(1, 10):
        for b in range(10):
            for c in range(10):
                n = a*10000 + b*1000 + c*100 + b*10 + a
                if n % sum(int(d) for d in str(n)) == 0:
                    count += 1
    return count

print(count_divisible_palindromes())

